<script src="../jquery-1.12.2.js"></script>
<button id="print">打印</button>
<button id="print1">打印1</button>
<button id="print2">打印2</button>
<script>
    /**
     * 原形
     */

    var ninePic = document.getElementById("ninePic")
    var print = document.getElementById("print")
    var print1 = document.getElementById("print1")
    var print2 = document.getElementById("print2")
    print.onclick = function () {
        var str = positions.join("")
        console.log(str);
    }
    print1.onclick = function () {
        var str = positions1.join("")
        console.log(str);
    }
    print2.onclick = function () {
        var str = positions2.join("")
        console.log(str);
    }
    var ninePicFlag = true
    var trs = ninePic.children
    var num = 0
    var positions = ["盒子"]
    var positions1 = ['像素']
    var positions2 = ['相对']

    for (var i = 0; i < trs.length; i++) {
        var tds = []
        tds[i] = trs[i].children;
        //取到的每一个td为 tds[tr索引][每个td索引]
        for (var j = 0; j < tds[i].length; j++) {
            tds[i][j].ninePicFlag = true
            tds[i][j].index = num
            num++
            tds[i][j].onmouseover= function () {
                this.style.backgroundColor = "#ff3040";
            }
            tds[i][j].onmouseout= function () {
                if (this.ninePicFlag) {
                    this.style.backgroundColor = "skyblue";
                }
            }
            tds[i][j].onclick = function () {

                if (this.ninePicFlag) {
                    this.style.transform = "rotateY(180deg)";
                    this.style.transition = "1s";
                    this.style.backgroundColor = "#ff3040";
//                    var position = ["'top:'", this.offsetTop / ninePic.offsetHeight, ",'left:'", this.offsetLeft / ninePic.offsetWidth, "||"]
//                    var position1 = ["'top:'", this.offsetTop, ",'left:'", this.offsetLeft, "||"]
//                    var position2 = ["'top:'", this.offsetTop/this.offsetHeight, ",'left:'", this.offsetLeft/this.offsetWidth, "||"]
//                    var str = position.join("")
//                    var str1 = position1.join("")
//                    var str2 = position2.join("")
                    var str = '{"top":'+ this.offsetTop / ninePic.offsetHeight+', "left":'+ this.offsetLeft / ninePic.offsetWidth+'},'
                    var str1 = '{"top":'+ this.offsetTop +', "left":'+ this.offsetLeft +'},'
                    var str2 = '{"top":'+ this.offsetTop / this.offsetHeight+', "left":'+ this.offsetLeft / this.offsetWidth+'},'
                    positions.push(str)
                    positions1.push(str1)
                    positions2.push(str2)
                    //flag = false;
                } else {
                    this.style.transform = "rotateY(0deg)";
                    this.style.transition = "1s";
                    this.style.backgroundColor = "skyblue";
                    //flag = true;
                    positions.pop()
                    positions1.pop()
                    positions2.pop()
                }
                this.ninePicFlag = !this.ninePicFlag
            }
        }
    }
    console.log(j);

</script>
</body>
